using Coretech.Crm.Utility.Util;
using System;
using System.Linq;
using System.Text;
using TuFactory.Domain.Enums;
using TuFactory.UptCard.Business;

namespace Coretech.Crm.Web.ISV.TU.CustAccount.UPTCard
{
    public partial class ShowDocument : System.Web.UI.Page
    {
        private string _applicationNo = string.Empty;
        private CardClientService _cardClientService;


        protected void Page_Load(object sender, EventArgs e)
        {
            if (!IsPostBack)
            {
                var bc = Request.Browser;
                var name = bc.Browser;
                if (name != "IE")
                {
                    bd.Style.Clear();
                    bd.Style.Add("overflow", "auto");

                }
                _applicationNo = QueryHelper.GetString("ApplicationNo");

                _cardClientService = new CardClientService();
                var documentResponse = _cardClientService.GetApplicationDocument(_applicationNo.Trim());

                //byte[] docContent = Convert.FromBase64String(@"");
                //Response.ClearHeaders();
                //Response.Clear();
                //Response.AddHeader("Content-Type", "application/pdf");
                //Response.AddHeader("Content-Length", docContent.Length.ToString());
                //Response.AddHeader("Content-Disposition", String.Format("inline; filename={0}.pdf", Guid.NewGuid()));
                //Response.BinaryWrite(docContent);
                //Response.Flush();
                //Response.End();

                if (documentResponse.ResponseStatus == ServiceResponseStatus.Success)
                {
                    var document = documentResponse.ServiceResponse.DOC_LIST.FirstOrDefault();
                    byte[] docContent = Convert.FromBase64String(document.DOC_CONTENT);

                    Response.ClearHeaders();
                    Response.Clear();
                    Response.AddHeader("Content-Type", "application/pdf");
                    Response.AddHeader("Content-Length", docContent.Length.ToString());
                    Response.AddHeader("Content-Disposition", String.Format("inline; filename={0}.pdf", Guid.NewGuid()));
                    Response.BinaryWrite(docContent);
                    Response.Flush();
                    Response.End();
                }
            }
        }
    }
}